import React from "react";
import "./projects.css";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import editor from "../../assets/editor.png";
import eCommerce from "../../assets/eCommerce.png";
import healthCard from "../../assets/healthCard.png";
import formFiller from "../../assets/formFiller.png";
import virtualTherapist from "../../assets/virtualTherapist.png";
import reservation from "../../assets/reservation.png";

const Projects = () => {
  const projectData = [
    {
      title: "Editor",
      description:
        "With the use of RectJs, I have developed an editor for merely HTML and CSS with a preview using the React library.",
      image: editor,
      githubLink: "https://github.com/dhruvi1930/editor",
    },
    {
      title: "E-Commerce",
      description:
        "With the use of RectJs and PHP for the backend, we have developed an e-commerce website with features like rating and Stripe payment method.",
      image: eCommerce,
      githubLink: "https://github.com/prog8185-f22/Project_Group4",
    },
    {
      title: "Health Card",
      description:
        "Developed a web application with my team members for the efficient maintenance of health records and analysis of trends in records. We used HTML, CSS, Ajax, PHP, and MySQL for implementation.",
      image: healthCard,
      githubLink: "https://github.com/dhruvi1930/Health-Card",
    },
    {
      title: "Automatic Form Filler",
      description:
        "Built an OCR model using ResNet and integrated it with Flask.",
      image: formFiller,
      githubLink: "https://github.com/dhruvi1930/form-filler",
    },
    {
      title: "Virtual Therapist",
      description:
        "Image preprocessing and feature extraction from Speech from RAVDESS dataset using Mel Frequency Coefficients (MFCC) for emotion detection and integrated the model in a GUI based on Python.",
      image: virtualTherapist,
      githubLink: "https://github.com/dhruvi1930/virtual-therapist",
    },
    {
      title: "Bus Reservation",
      description:
        "This application basically uses a WPF application to make and cancel bus reservations. Passengers have the option of booking a seat in advance and can view the seats that have already been reserved.",
      image: reservation,
      githubLink: "https://github.com/dhruvi1930/Bus-Reservation",
    },
  ];

  const sliderSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 5000, // Adjust this value to control the autoplay speed
  };

  return (
    <section id="projects">
      <h2 className="projectsTitle">My Projects</h2>
      <div className="projectsWrapper">
        <Slider {...sliderSettings}>
          {projectData.map((project, index) => (
            <div key={index} className="container">
              <img
                src={project.image}
                alt={project.title}
                className="projectImage"
              />
              <h3>{project.title}</h3>
              <p className="projectDescription">{project.description}</p>
              <a href={project.githubLink}>
                <button className="btnProject">GitHub</button>
              </a>
            </div>
          ))}
        </Slider>
      </div>
    </section>
  );
};

export default Projects;
